    false,nt"url": null,nt"notes": "This narrative report for Clarence Rhode
    National Wildlife Range and Nunivak National Wildlife Refuge outlines Refuge accomplishments
    from May through August of 1963. The report begins by summarizing the weather conditions,
    habitat conditions, water conditions, and food and cover during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, raptors,
    fish, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, collections and receipts, and wildfires.
    Resource management is outlined; topics include grazing, haying, fur harvesting,
    timber removal, and commercial fishing. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, hunting, violations, and safety. Items
    of interest and photographs are attached.",nt"license_title": "License Not
